def this_function(s: str) -> bool:
    ''' Check if The name shall not contain letters a-z, letters A-Z and spaces.'''
    for c in s:
        if c == ' ' or c.isalpha():
            return False
    return True

def this_function(s: str) -> bool:
    ''' Check if The name shall contain no space character.'''
    return ' ' not in s
